// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IGulliverLiquidity {

   function setGulliverOwner() external;

   function blockNFT(uint256 tokenId) external;

   function increaseLiquidityCurrentRange(uint256 tokenId, uint256 amountAdd0, uint256 amountAdd1) external
   returns (uint128 liquidity, uint256 amount0, uint256 amount1, address token0, address token1);

   function collectAllFees(uint256 tokenId) external returns (uint256 amount0, uint256 amount1, address token0, address token1);

   function swapExactInputSingle(uint256 amountIn,  uint256 tokenId, address tokenIn) external
   returns (uint256 amountOut, address tokenOut);

   function checkPool(address from, address to) external view returns (address _pool, uint256 NTFid, address token0, address token1);

   function getDeposits(uint256 tokenId) external view
   returns (address owner, uint128 liquidity, address token0, address token1, uint24 fee);

   function getPool(address tokenA, address tokenB) external view returns (address poolAddress);

   function getPools() external view returns(address[] memory);

   function getPoolNTF(address poolAddress) external view returns(uint256 tokenId);

   function ownerIsGulliver() external view returns(address);

   function balanceOf(address token_, address account) external view returns(uint);

}
